import React, { useState } from "react"; 
import Header from "./Header";
const Copywrite=()=>{
    const year=new Date();
    const [words,setWord]=useState("")
    const clickbutton=()=>{
        const word="hello why do you press subscribe" 
       setWord(word)  
    }
     return(
        <div>
     <p>"this version is Copyright &copy; {year.getFullYear()} "</p>
    <button onClick={clickbutton}>Subscribe</button><p>{words}</p>
    <Header name=" sachin " age="80"></Header>
    </div>)
}
export default Copywrite
